// src/components/Pacjent/PacjentList.js
import React, { useState, useEffect } from 'react';
import api from '../../api';

const PacjentList = () => {
  const [pacjenci, setPacjenci] = useState([]);

  useEffect(() => {
    // Pobierz listę pacjentów z API po załadowaniu komponentu
    api.get('/pacjenci/')
      .then(response => setPacjenci(response.data))
      .catch(error => console.error('Błąd pobierania pacjentów:', error));
  }, []);

  return (
    <div>
      <h2>Lista Pacjentów</h2>
      <ul>
        {pacjenci.map(pacjent => (
          <li key={pacjent.id}>{pacjent.imie} {pacjent.nazwisko}</li>
        ))}
      </ul>
    </div>
  );
};

export default PacjentList;
